  "inlineSchema": "generator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// User model for authentication\nmodel User {\n  id        String   @id @default(uuid())\n  email     String   @unique\n  password  String\n  name      String\n  role      String   @default(\"user\") // user, admin\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  clients    Client[]\n  invoices   Invoice[]\n  quotations Quotation[]\n  sph        SPH[]\n  settings   CompanySettings?\n}\n\n// Client/Customer model\nmodel Client {\n  id          String   @id @default(uuid())\n  userId      String // Owner of this client\n  name        String\n  contactName String?\n  email       String?\n  phone       String?\n  address     String?\n  city        String?\n  postalCode  String?\n  country     String   @default(\"Indonesia\")\n  taxId       String? // NPWP for Indonesian clients\n  notes       String?\n  status      String   @default(\"active\") // active, inactive\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  user       User        @relation(fields: [userId], references: [id])\n  invoices   Invoice[]\n  quotations Quotation[]\n  sph        SPH[]\n}\n\n// Invoice model\nmodel Invoice {\n  id            String   @id @default(uuid())\n  invoiceNumber String   @unique\n  clientId      String\n  userId        String\n  issueDate     DateTime @default(now())\n  dueDate       DateTime\n  projectName   String?\n  poNumber      String?\n\n  // Financial\n  subtotal  Decimal @db.Decimal(15, 2)\n  taxRate   Decimal @default(11) @db.Decimal(5, 2)\n  taxAmount Decimal @db.Decimal(15, 2)\n  discount  Decimal @default(0) @db.Decimal(15, 2)\n  total     Decimal @db.Decimal(15, 2)\n\n  // Status\n  status String @default(\"draft\") // draft, sent, paid, overdue, cancelled\n\n  // Additional\n  notes         String?\n  terms         String?\n  bankAccount   String?\n  signatureName String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  client   Client          @relation(fields: [clientId], references: [id])\n  user     User            @relation(fields: [userId], references: [id])\n  items    InvoiceItem[]\n  payments PaymentRecord[]\n}\n\n// Invoice Line Items\nmodel InvoiceItem {\n  id          String  @id @default(uuid())\n  invoiceId   String\n  groupName   String?\n  model       String?\n  description String\n  quantity    Int\n  unit        String  @default(\"unit\")\n  rate        Decimal @db.Decimal(15, 2)\n  amount      Decimal @db.Decimal(15, 2)\n\n  invoice Invoice @relation(fields: [invoiceId], references: [id], onDelete: Cascade)\n}\n\n// Payment Records for tracking\nmodel PaymentRecord {\n  id          String   @id @default(uuid())\n  invoiceId   String\n  amount      Decimal  @db.Decimal(15, 2)\n  paymentDate DateTime\n  method      String? // bank_transfer, cash, etc.\n  reference   String?\n  notes       String?\n  createdAt   DateTime @default(now())\n\n  invoice Invoice @relation(fields: [invoiceId], references: [id], onDelete: Cascade)\n}\n\n// Quotation model (similar structure to Invoice)\nmodel Quotation {\n  id              String   @id @default(uuid())\n  quotationNumber String   @unique\n  clientId        String\n  userId          String\n  issueDate       DateTime @default(now())\n  validUntil      DateTime\n  projectName     String?\n\n  subtotal  Decimal @db.Decimal(15, 2)\n  taxRate   Decimal @default(11) @db.Decimal(5, 2)\n  taxAmount Decimal @db.Decimal(15, 2)\n  discount  Decimal @default(0) @db.Decimal(15, 2)\n  total     Decimal @db.Decimal(15, 2)\n\n  status        String  @default(\"draft\") // draft, sent, accepted, rejected, expired\n  notes         String?\n  terms         String?\n  bankAccount   String?\n  signatureName String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  client Client          @relation(fields: [clientId], references: [id])\n  user   User            @relation(fields: [userId], references: [id])\n  items  QuotationItem[]\n}\n\nmodel QuotationItem {\n  id          String  @id @default(uuid())\n  quotationId String\n  groupName   String?\n  model       String?\n  description String\n  quantity    Int\n  unit        String  @default(\"unit\")\n  rate        Decimal @db.Decimal(15, 2)\n  amount      Decimal @db.Decimal(15, 2)\n\n  quotation Quotation @relation(fields: [quotationId], references: [id], onDelete: Cascade)\n}\n\n// SPH (Surat Penawaran Harga) model\nmodel SPH {\n  id          String   @id @default(uuid())\n  sphNumber   String   @unique\n  clientId    String\n  userId      String\n  issueDate   DateTime @default(now())\n  validUntil  DateTime\n  projectName String?\n  poReference String?\n\n  subtotal  Decimal @db.Decimal(15, 2)\n  taxRate   Decimal @default(11) @db.Decimal(5, 2)\n  taxAmount Decimal @db.Decimal(15, 2)\n  discount  Decimal @default(0) @db.Decimal(15, 2)\n  total     Decimal @db.Decimal(15, 2)\n\n  status String  @default(\"draft\") // draft, sent, accepted, rejected\n  notes  String?\n  terms  String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  client Client    @relation(fields: [clientId], references: [id])\n  user   User      @relation(fields: [userId], references: [id])\n  items  SPHItem[]\n}\n\nmodel SPHItem {\n  id          String  @id @default(uuid())\n  sphId       String\n  model       String? // Product model/code\n  description String\n  quantity    Int\n  unit        String  @default(\"unit\")\n  rate        Decimal @db.Decimal(15, 2)\n  amount      Decimal @db.Decimal(15, 2)\n\n  sph SPH @relation(fields: [sphId], references: [id], onDelete: Cascade)\n}\n\n// Company Settings\nmodel CompanySettings {\n  id          String  @id @default(uuid())\n  userId      String  @unique // Each user has their own settings\n  companyName String\n  legalName   String?\n  taxId       String? // NPWP\n  email       String?\n  phone       String?\n  address     String?\n  city        String?\n  postalCode  String?\n  country     String  @default(\"Indonesia\")\n  logo        String? // URL or base64\n  workshop    String? // Workshop address\n\n  // Document Configuration\n  documentIntroText String? // Template: \"Dengan ini kami sampaikan Rincian order PO : {PO_NUMBER} Sebagai berikut :\"\n  defaultTerms      String? // Default Syarat dan Ketentuan\n\n  // Signature\n  signatureImage String? // Base64 or URL for signature image\n  signatureName  String? // Name to display under signature\n\n  // Default Tax\n  defaultTaxName String  @default(\"PPN\")\n  defaultTaxRate Decimal @default(11) @db.Decimal(5, 2)\n\n  // Invoice Numbering\n  invoicePrefix  String @default(\"INV/{YYYY}/{MM}/\")\n  invoiceNextNum Int    @default(1)\n  invoicePadding Int    @default(5)\n\n  // Quotation Numbering\n  quotationPrefix  String @default(\"QT/{YYYY}/{MM}/\")\n  quotationNextNum Int    @default(1)\n\n  // SPH Numbering\n  sphPrefix  String @default(\"SPH/{YYYY}/\")\n  sphNextNum Int    @default(1)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user         User          @relation(fields: [userId], references: [id])\n  bankAccounts BankAccount[]\n}\n\n// Bank Accounts\nmodel BankAccount {\n  id         String   @id @default(uuid())\n  bankName   String\n  accountNum String\n  holderName String\n  isDefault  Boolean  @default(false)\n  createdAt  DateTime @default(now())\n  updatedAt  DateTime @updatedAt\n\n  // Relation to CompanySettings\n  settingsId String?\n  settings   CompanySettings? @relation(fields: [settingsId], references: [id])\n}\n",
